 // check row\n      for (uint8 k=0; k<7; k++) {\n\tif (grid[k][row] == player) {\n\t  count++;\n\t  if (count == 4) {\n\t    sendPayout(player);\n\t    return;\n\t  }\n\t} else {\n\t  count = 0;\n\t}\n      }\n      count = 0;\n      \n      // check left to right diagonals\n      while (currentRow != 0 && currentColumn != 0) {\n\tcurrentRow--;\n\tcurrentColumn--;\n      }\n      while (currentRow <= 5 && currentColumn <= 6) {\n\tif (grid[currentColumn][currentRow] == player) {\n\t  if (count == 3) {\n\t    sendPayout(player);\n\t    return;\n\t  }\n\t  count++;\n\t} else {\n\t  count = 0;\n\t}\n\tcurrentRow++;\n\tcurrentColumn++;\n      }\n      currentRow = row;\n      currentColumn = column;\n      count = 0;\n\n      // check right to left diagonals\n      while (currentRow != 0 && currentColumn != 6) {\n\tcurrentRow--;\n\tcurrentColumn++;\n      }\n      while (currentRow <= 5 && currentColumn >= 0 && currentColumn < 7) {\n\tif (grid[currentColumn][currentRow] == player) {\n      \t  if (count == 3) {\n      \t    sendPayout(player);\n      \t    return;\n      \t  }\n      \t  count++;\n      \t} else {\n      \t  count = 0;\n\t}\n      \tcurrentRow++;\n      \tcurrentColumn--;\n      }\n      currentRow = row;\n      currentColumn = column;\n      count = 0;\n\n    }\n\n    function sendPayout(address player) private {\n      emit Winner(player);\n      player.transfer(address(this).balance);\n    }\n}\n",sourcePath:"/home/eric/CryptoApps/truffle_connect_four/contracts/ConnectFour.sol",ast:{absolutePath:"/home/eric/CryptoApps/truffle_connect_four/contracts/ConnectFour.sol",exportedSymbols:{ConnectFour:[434]},id:435,nodeType:"SourceUnit",nodes:[{id:1,literals:["solidity","^","0.4",".23"],nodeType:"PragmaDirective",src:"0:24:0"},{baseContracts:[],contractDependencies:[],contractKind:"contract",documentation:null,fullyImplemented:!0,id:434,linearizedBaseContracts:[434],name:"ConnectFour",nodeType:"ContractDefinition",nodes:[{constant:!1,id:3,name:"red",nodeType